INSERT INTO `MASTER_JABATAN` VALUES (1,'Barista','','membuat berbagai jenis minuman kopi yang di pesan oleh pelanggan.','membuat dan menyajikan kopi kepada pelanggan',NULL,'1.2.',NULL,NULL,NULL,NULL,'membuat dan menyajikan kopi kepada pelanggan'),(2,'Barker','','','membuat semua jenis roti dan kue',NULL,'1.2.',NULL,NULL,NULL,NULL,'membuat semua jenis roti dan kue'),(3,'Bartender','','Membuat minuman sesuai dengan order dari tamu sesuai dengan service prosedur  yang ditetapkan dan standard reciepe, Melaksanakan daily inventory, closing dan opening baik minuman maupun peralatan.','Membuat minuman sesuai dengan orderan tamu dan harus sesuai dengan standard Perusahaan serta memberikan kepuasan kepada tamu semaksimal mungkin',NULL,'1.2.',NULL,NULL,NULL,NULL,'Membuat minuman sesuai dengan orderan tamu dan harus sesuai dengan standard Perusahaan serta memberikan kepuasan kepada tamu semaksimal mungkin'),(8,'Captain Waiter','','Cek kehadiran karyawan, cek daftar pesanan, cek persediaan barang, cek kebersihan area restoran, mencatat barang masuk, membimbing karyawan baru, koordinasi dengan supervisor tentang operasional harian, memastikan terlaksananya general cleaning setiap bul','wakil supervisor yang membantu supervisor dalam penanganan operasional',NULL,'1.2.',NULL,NULL,NULL,NULL,''),(9,'Cake Decorator','','mempercantik kue agar semakin menarik ','menutup kue/ cake dengan bahan penghias atau memberikan hiasan pada kue/ cake',NULL,'1.2.',NULL,NULL,NULL,NULL,''),(10,'Chef','','','',NULL,'1.2.',NULL,NULL,NULL,NULL,''),(11,'Chef De Partie','','mengawasi dan membantu dalam memasak, persiapan dan penyajian makanan di restoran','kepala bagian dapur ',NULL,'1.2.',NULL,NULL,NULL,NULL,''),(12,'Commis','','Mendukung eksekutif chef, sous chef, commis chef serta karyawan dapur lainnya dalam produksi pangan, Membantu staf dapur dalam menjaga standar masakan tinggi bagi klien fungsi serta delegasi, Membantu para commis chef dalam produksi makanan yang berbeda u','staff dapur ',NULL,'1.2.',NULL,NULL,NULL,NULL,''),(13,'Cook','','turun tangan langsung mengolah makanan','Juru Masak',NULL,'1.2.',NULL,NULL,NULL,NULL,''),(14,'Waiter','','Melayani tamu. Bertanggungjawab pada persiapan restoran sebelum dibuka, melengkapi semua perlengkapan yang akan di gunakan dalam operasional, seperti chinawares, silverwares, glasswares, dan lain-lain','bagian front liner, mempunyai peran penting dalam operasional restoran dan memberikan kepuasan layanan kepada tamu restoran',NULL,'1.2.',NULL,NULL,NULL,NULL,''),(15,'Bell Boy','','melayani tamu dengan menangani barang barangnya saat check in atau check out mencatat semua barang, koper yang dititipkan baik sementara maupun yang dititipkan lebih dari 24 jam, mengisi daftar pulang, mengirim pesan tamu','Petugas pelayanan barang dikantor depan yang mengurus barang bawaan tamu serta tugas lainya pada saat tamu melakukan check-in, check-out atau room change',NULL,'1.3.',NULL,NULL,NULL,NULL,''),(16,'Male Cleaners','','','',NULL,'1.3.',NULL,NULL,NULL,NULL,''),(17,'Male Service Crew','','','',NULL,'1.3.',NULL,NULL,NULL,NULL,''),(18,'Receptionist/FO','','menjawab semua panggilan masuk dan mengarahkan panggilan orang yang tepat atau departemen','penerima tamu',NULL,'1.3.',NULL,NULL,NULL,NULL,''),(19,'Telephone Operator','','mengoperasikan switchboard dengan benar, menjaga kebersihan swithboard/tempat kerja, melayani sambungan lokal, interlokal, internasional, melayani pengiriman faksimili dari manajemen hotel, mecatat dan menyampaikan pesan dari tamu, membuat laporan sambung','kantor depan yang bertanggungjawab atas penanganan sambungan telephone, baik yang masuk maupun keluar hotel',NULL,'1.3.',NULL,NULL,NULL,NULL,''),(20,'Swimming Pool Attendant','','menjaga kebersihan kolan renang. baik di area sekitar kolam maupun di dalam kolam renang, serta bertanggung jawab atas peredaran handuk atau pool towel yang dipergunakan tamu, merawat mesin pompa ','bagian yang bertugas dan bertanggung jawab menjaga kebersihan kolan renang. baik di a