INSERT INTO `MASTER_PPTKIS` VALUES (1,'PT. PRIMA DUTA SEJATI','JL.KAYU BESAR DALAM NO 18 RT.08 RW.11 CENGKARENG TIMUR',NULL,'KEP. 563/ 245/424.078/2017','Prima Duta Sejati Ltd adalah perusahaan pemasok tenaga kerja resmi dengan nomor ijin kerja 717 / MEN','<style type=\"text/css\"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--></style><span style=\"font-size: 10pt;\" data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Perusahaan kami, Prima Duta Sejati Ltd adalah perusahaan pemasok tenaga kerja resmi dengan nomor ijin kerja 717 / MEN / 2006 Prima Duta Sejati Ltd, didirikan pada tahun 1995, dimana beberapa direktur mulai mengeksplorasi bidang ini di luar negeri sampai tahun 1997, setelah 2 tahun pengalaman di luar negeri, direksi merasa sudah saatnya kembali ke Indonesia dengan visi dan misi untuk mendirikan perusahaan pemasok ketenagakerjaan, pada saat itu di bawah lisensi perusahaan lain di Surabaya. Dua tahun kemudian, dengan anugerah Tuhan, Prima Duta Sejat Ltd. didirikan di Surabaya. Pada tahun 2001, perusahaan tersebut dipindahkan ke lokasi yang lebih besar dan lebih baik di kota Gempol, pasuruan di Jawa Timur. Kami telah berada di sini sejak. Pusat pelatihan Prima Duta Sejati Ltd. Berdiri di atas tanah seluas 17.000 m2 dengan total luas bangunan 12.000 m2 yang dapat menampung 1200 orang sekaligus. \\nDi Prima Duta Sejati, pilihan calon pekerja dilakukan dengan sangat hati-hati untuk memastikan kualitas pekerja yang akan ditempatkan di luar negeri. Kami juga memiliki sistem kurikulum yang baik untuk pengajaran bahasa asing yang telah terbukti selama bertahun-tahun. Persentase pekerja kita yang gagal dalam pekerjaan karena ketidakmampuan bahasa kurang dari 5%. Pusat pelatihan terdiri dari 39 kelas dengan teknisi laboratorium bahasa. Ada juga 137 kamar mandi, fasilitas olah raga, 1200 tempat tidur, ruang kantor, dan lainnya. Semua fasilitas ini berkontribusi dalam membantu menciptakan pekerja berkualitas yang ditempatkan oleh Prima Duta Sejati di sektor pembantu rumah tangga, perawat, nelayan, perhotelan dan pekerja industri.\\nDengan total 35 instruktur bersertifikat pemerintah berpengalaman yang mengajarkan keterampilan bahasa kepada pekerja bahasa Kantonis, Inggris, dan Mandarin, dan juga staf administrasi dari 40 orang untuk menangani setiap divisi sesuai dengan negara tujuan. Sejak akhir tahun 1999 sampai 2007, Prima Duta Sejati telah berhasil menempatkan lebih dari 23 ribu pekerja formal dan informal di Jepang, Taiwan, Hong Kong, Singapura, Macau, Aruba dan Malaysia dengan tingkat keberhasilan 95%.\\nPrima Duta Sejati juga bekerja sama dengan PPNI, beberapa akademi Institut Kesehatan untuk merekrut perawat yang berkualitas dan dapat dipercaya. Prima Duta Sejati memiliki fasilitas yang lengkap untuk melatih perawat dengan instruktur bersertifikasi paling banyak dengan pengalaman di luar negeri untuk memastikan kualitas perawat kami terutama ke Taiwan.&quot;}\" data-sheets-userformat=\"{&quot;2&quot;:2110337,&quot;3&quot;:[null,0],&quot;10&quot;:1,&quot;11&quot;:4,&quot;12&quot;:0,&quot;15&quot;:&quot;Arial&quot;,&quot;16&quot;:10,&quot;24&quot;:[null,0,3,0,3]}\"><font face=\"arial\">Perusahaan kami, Prima Duta Sejati Ltd adalah perusahaan pemasok tenaga kerja resmi dengan nomor ijin kerja 717 / MEN / 2006 Prima Duta Sejati Ltd, didirikan pada tahun 1995, dimana beberapa direktur mulai mengeksplorasi bidang ini di luar negeri sampai tahun 1997, setelah 2 tahun pengalaman di luar negeri, direksi merasa sudah saatnya kembali ke Indonesia dengan visi dan misi untuk mendirikan perusahaan pemasok ketenagakerjaan, pada saat itu di bawah lisensi perusahaan lain di Surabaya. Dua tahun kemudian, dengan anugerah Tuhan, Prima Duta Sejat Ltd. didirikan di Surabaya. Pada tahun 2001, perusahaan tersebut dipindahkan ke lokasi yang lebih besar dan lebih baik di kota Gempol, pasuruan di Jawa Timur. Kami telah berada di sini sejak. Pusat pelatihan Prima Duta Sejati Ltd. Berdiri di atas tanah seluas 17.000 m2 dengan total luas bangunan 12.000 m2 yang dapat menampung 1200 orang sekaligus. <br><br>Di Prima Duta Sejati, pilihan calon pekerja dilakukan dengan sangat hati-hati untuk memastikan kualitas pekerja yang akan ditempatkan di luar negeri. Kami juga memiliki sistem kurikulum yang baik untuk pengajaran bahasa asing yang telah terbukti selama bertahun-tahun. Persentase pekerja kita yang gagal dalam pekerjaan karena ketidakmampuan bahasa kurang dari 5%. Pusat pelatihan terdiri dari 39 kelas dengan teknisi laboratorium bahasa. Ada juga 137 kamar mandi, fasilitas olah raga, 1200 tempat tidur, ruang kantor, dan lainnya. Semua fasilitas ini berkontribusi dalam membantu menciptakan pekerja berkualitas yang ditempatkan oleh Prima Duta Sejati di sektor pembantu rumah tangga, perawat, nelayan, perhotelan dan pekerja industri.<br><br>Dengan total 35 instruktur bersertifikat pemerintah berpengalaman yang mengajarkan keterampilan bahasa kepada pekerja bahasa Kantonis, Inggris, dan Mandarin, dan juga staf administrasi dari 40 orang untuk menangani setiap divisi sesuai dengan negara tujuan. Sejak akhir tahun 1999 sampai 2007, Prima Duta Sejati telah berhasil menempatkan lebih dari 23 ribu pekerja formal dan informal di Jepang, Taiwan, Hong Kong, Singapura, Macau, Aruba dan Malaysia dengan tingkat keberhasilan 95%.<br><br>Prima Duta Sejati juga bekerja sama dengan PPNI, beberapa akademi Institut Kesehatan untuk merekrut perawat yang berkualitas dan dapat dipercaya. Prima Duta Sejati memiliki fasilitas yang lengkap untuk melatih perawat dengan instruktur bersertifikasi paling banyak dengan pengalaman di luar negeri untuk memastikan kualitas perawat kami terutama ke Taiwan.</font></span>','021 55953329','PPTKIS_LOGO_c4ca4238a0b923820dcc509a6f75849b.jpg','PPTKIS_COVER_c4ca4238a0b923820dcc509a6f75849b.jpg',''),(2,'PT. SANJAYA PUTRA PERKASA',NULL,NULL,'KEP.MEN no 565 tahun 2016','PT Sanjaya Putera Perkasa menempatkan Tenaga Kerja ke Taiwan, Hongkong, Malaysia, Singapura','<div style=\"text-align: left;\"><span style=\"font-family: Arial;\">PT Sanjaya Putera Perkasa adalah Badan Usaha Perseroan yang bergerak dibidang jasa penempatan Tenaga Kerja Indonesia ke Luar Negeri.</span><b><br></b></div><div style=\"text-align: left;\"><span style=\"font-family: Arial;\"><br></span></div><div style=\"text-align: center;\"><b><span style=\"font-family: Arial;\">Arah dan Kebijakan Perusahaan&nbsp;</span></b></div><div><span style=\"font-family: Arial;\">Dalam rangka upaya pelaksanaan kebijakan peruhaan dalam usaha jasa pelayanan penempatan TKI ke Luar Negeri berpedoman pada:</span><div><span style=\"font-family: Arial;\">1. Tenaga Kerja Indonesia yang kami tempatkan bekerja pada sektor pekerjaaan Formal dan Informal</span></div><div><span style=\"font-family: Arial;\">2. Dalam hal penempatan kami berkomitmen meningkatkan kualitas dan kuantitas TKI dari semi terampil menjadi TKI terampil</span></div><div><span style=\"font-family: Arial;\">3. Menjalin kerjasama dengan instansi pemerintah baik pusat maupun di daerah daerah</span></div><div><span style=\"font-family: Arial;\">4. Menjalin kerjasama dengan mitra kerja kami di luar negeri dengan intensif</span></div></div>',NULL,'PPTKIS_LOGO_c81e728d9d4c2f636f067f89cc14862c.jpeg','PPTKIS_COVER_c81e728d9d4c2f636f067f89cc14862c.jpg','PPTKIS_STRUKTUR_ORGANISASI_c81e728d9d4c2f636f067f89cc14862c.png'),(3,'PT. FORWARD GLOBAL','Jl. Raya Tanjung No 52 – 54 Gempol',NULL,'SIUP NOMOR 444 TAHUN 2016','Perusahaan penempatan tenaga kerja Indonesia swasta (PPTKIS) ke negara Taiwan','<span style=\"font-family: Arial;\">PT. FORWARD GLOBAL sebagai perusahaan penempatan tenaga kerja Indonesia swasta (PPTKIS), berdiri sejak tahun 2005, dengan alamat di : Jl. Kayu Besar Dalam No. 18 Cengkareng Jakarta Barat 11730. PT FORWARD GLOBAL  adalah sebuah Perusahaan Pelaksana Penempatan Tenaga Kerja Indonesia Swasta yang menempatkan Tenaga Kerja Indonesia ke Luar Negeri baik di sektor Formal maupun Informal dengan Negara Tujuan Penempatan yaitu TAIWAN.</span><div><span style=\"font-family: Arial;\"><br></span></div><div><div style=\"text-align: center;\"><span style=\"font-family: Arial;\"><b>VISI</b></span></div><div><span style=\"font-family: Arial;\">Pengentasan kemiskinan, pengembangan sumber daya manusia dan meningkatkan taraf hidup masyarakat</span></div><div><span style=\"font-family: Arial;\"><br></span></div><div style=\"text-align: center;\"><span style=\"font-family: Arial;\"><b>MISI</b></span></div><div><span style=\"font-family: Arial;\">1. Mengurangi pengangguran dengan memperluas lapangan kerja ke Luar Negeri.</span></div><div><span style=\"font-family: Arial;\">2. Meningkatkan kualitas kerja.</span></div><div><span style=\"font-family: Arial;\">3. Menciptakan kemampuan profesional dan etos kerja produktif bagi TKI.</span></div><div><span style=\"font-family: Arial;\">4. Meningkatkan perlindungan Tenaga Kerja.</span></div><div><span style=\"font-family: Arial;\">5. Meningkatkan kesejahteraan Tenaga Kerja.</span></div></div>','098019231','PPTKIS_LOGO_eccbc87e4b5ce2fe28308fd9f2a7baf3.png','PPTKIS_COVER_eccbc87e4b5ce2fe28308fd9f2a7baf3.jpg','PPTKIS_STRUKTUR_ORGANISASI_eccbc87e4b5ce2fe28308fd9f2a7baf3.PNG'),(4,'PT. BINAMANDIRI MULIARAHARJA','',NULL,'','','','','PPTKIS_LOGO_a87ff679a2f3e71d9181a67b7542122c.jpg','PPTKIS_COVER_a87ff679a2f3e71d9181a67b7542122c.jpg','PPTKIS_STRUKTUR_ORGANISASI_a87ff679a2f3e71d9181a67b7542122c.png'),(5,'PT. DINASTY INSAN MANDIRI',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'PT. TIMURAYA JAYA LESTARI',NULL,NULL,'SIUP','PT. TIMURAYA JAYA LESTARI has grown to a large and highly respected man power supplier in Indonesia,','PT. TIMURAYA JAYA LESTARI has grown to a large and highly respected man power supplier in Indonesia, which is experienced in placing Indonesian formal and skilled workers in Asia-Pacific and Middle-East countries. Recently we boast an extensive range of modern training facilities, spacious office building, a vast recruitment network and very highly skilled staffs.',NULL,'PPTKIS_LOGO_1679091c5a880faf6fb5e6087eb1b2dc.PNG','PPTKIS_COVER_1679091c5a880faf6fb5e6087eb1b2dc.jpg','PPTKIS_STRUKTUR_ORGANISASI_1679091c5a880faf6fb5e6087eb1b2dc.png'),(7,'Karyatama Mitra Sejati',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'Prima Duta Sejati',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'Hamparan Karya Insani',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'Kijang Lombok Raya',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Sahara Fajarindo Corp',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'Citra Catur Utama Karya',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Berkat Sukses Makmur Sejahtera',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Sampeang Alifid Mandiri',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,'Tiaramas Ronagemilang',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,'Perwita Nusaraya',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,'Haena Duta Cemerlang',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,'Sukamulia Mandiri Agung',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,'Asamulia Indoman Power',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,'Buana Rizqia Duta Selaras',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,'Suma Jaya.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(22,'Bandar Laguna',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,'Esdema Mandiri',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,'Bhakti Persada Jaya',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(25,'Dian Kharisma Mandiri',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(26,'Asa Jaya',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,'Cipta Rezeki Utama',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(28,'Dewi Pengayom Bangsa',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(29,'Lintas Cakrawala Buana',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(30,'Citra Abdi Nusa',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(31,'Pansomal Tirtanadi',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(32,'PT AN